<!DOCTYPE html>
<html lang="en">
<head>
<meta charset="UTF-8">
<meta name="viewport" content="width=device-width, initial-scale=1.0">
<title>Cybersecurity Threats</title>
<style>
body {
    margin: 0;
    font-family: Arial, sans-serif;
    background: #0b0b0b;
    color: #ffffff;
    display: flex;
    flex-direction: column;
    align-items: center;
}
.container {
    max-width: 900px;
    text-align: center;
    padding: 20px;
}
h1 {
    color: #ff3b3b;
    letter-spacing: 2px;
}
.flyer img {
    width: 100%;
    border-radius: 8px;
}
.icons {
    display: flex;
    justify-content: space-around;
    margin-top: 20px;
}
.icon-btn {
    width: 80px;
    height: 80px;
    border-radius: 50%;
    border: 2px solid #ff3b3b;
    background: transparent;
    cursor: pointer;
}
.icon-label {
    margin-top: 8px;
    color: #ff3b3b;
    font-size: 14px;
}
.modal {
    display: none;
    position: fixed;
    top: 0; left: 0;
    width: 100%; height: 100%;
    background: rgba(0,0,0,0.8);
    justify-content: center;
    align-items: center;
    z-index: 10;
}
.modal-content {
    background: #111;
    padding: 20px;
    border: 2px solid #ff3b3b;
    border-radius: 8px;
    max-width: 500px;
    text-align: left;
}
.close-btn {
    float: right;
    cursor: pointer;
    color: #ff3b3b;
    font-weight: bold;
}
</style>

<script>
const texts = {
  phishing: "Phishing is a social engineering attack in which attackers trick users into revealing sensitive information such as passwords or credit card details through fake emails or websites.",
  malware: "Malware is malicious software designed to infiltrate, damage, or disrupt systems, including viruses, ransomware, and spyware.",
  hacking: "Hacking involves unauthorized access to systems or networks to steal data, disrupt services, or cause damage.",
  databreach: "A data breach occurs when confidential information is accessed or disclosed without authorization.",
  wifi: "Wi-Fi sniffing is when attackers intercept data transmitted over the unsecured wireless networks."
};

function openModal(type) {
  document.getElementById('modal-text').innerText = texts[type];
  document.getElementById('modal').style.display = 'flex';
}

function closeModal() {
  document.getElementById('modal').style.display = 'none';
}
</script>
